import React from 'react';
import cssClasses from './home.module.scss'

const App = () => {
    return <div className={cssClasses.Joblers}>
        <h1 className={cssClasses.Joblers__title}>Hello NextJs</h1>
        <h2 className={cssClasses.h2}>Testing</h2>
        <p>This is the paragraph</p>
        <div className={cssClasses.Joblers__background}/>
        <button onClick>Go To Docs</button>
    </div>
}

export default App;
